This is it! Keiran's got just a few short hours left on his whirlwind journey. Complications ensue, however, when Manuel asks Keiran to pick up his friend at the train station. But Keiran has to catch his connection to Los Angeles... Oh, did we mention that Manu's friend is porn legend Sandra Romain? Of-course Keiran picks her up! And all three have one last gift to share with all of you! You're welcome!
